const ShowSearchedMovie= props=>{
    return(
        <div className={classes.clearfix}>
            <div class={"img-container"}>
                <p>{props.title}</p>
                <p>{props.description}</p>
                <img 
                // style={{ height: "220px", width: "241px" }}
                src={props.image} alt="" />
            </div>

        </div >
    );
};

export default ShowSearchedMovie;
